    font-weight:400;
}
body {
    margin:0;
    text-align:center;
}
h1,h2,h3,h4,h5 {
    font-family:PatuaOne;
}


/* Track
---------------------*/
.track {
    width:250px;
    height:250px;
    position:relative;
    display:inline-block;
    margin:10px;
    cursor:pointer;
}

.track img {
    width:250px;
}

.track .track-text {
    position: absolute;
    bottom:0;
    left:0;
    right:0;
    background:rgba(0,0,0,.7);
    color:#ddd;
    padding:5px;
    margin:0;
}

.track-icon {
    position: absolute;
    top:50%;
    left:50%;
    color:#fff;
    background:rgba(0,0,0,.7);
    width:50px;
    height:50px;
    line-height:50px;
    margin:-25px 0 0 -25px;
    border-radius:50%;
}
